import React from "react";
import { ListImage } from "../components/image";
import changePicture from "../components/changePicture";

const index = () => {
    return (
        <>
            <div class="text-6xl">Slider </div>
            <div class="flex flex-no-wrap bg-gray-200 overflow-hidden p-10">
                {ListImage.map(src => (
                    <img class="w-1/2 rounded-lg mx-2" src={src} />
                ))}
            </div>
            <div class="text-center m-5">
                <button class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full mx-5 " onClick={changePicture("L")}> {"<-"} </button>
                <button class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full" onClick={changePicture("R")}> {"->"} </button>
            </div>
        </>
    )
}

export default index;
